import * as React from "react";

import {
    Box,
    Paper,
    TextField,
  } from "@mui/material";
import Drawer from "../Drawer/Drawer";



const Notificaion = () => {
    const [value, setValue] = React.useState(new Date());
    const [value2, setValue2] = React.useState(new Date());

    return (
        <div>
          <header className="App-header">
            <Navbars />
          </header>

          <Box sx={{ display: "flex", width: "100% " }}>
            <Drawer />

            <div style={{ marginTop: 60, height: 100 }}>
              <h4
                style={{
                  fontWeight: 500,
                  fontSize: 36,
                  color: " #333333",
                  marginLeft: 20,
                  position: "absolute",
                  top: "13%",
                }}
              >
                Notification
              </h4>
              <Paper
                component="form"
                sx={{
                  p: "2px 4px",
                  display: "flex",
                  alignItems: "center",
                  width: 330,
                  position: "absolute",
                  left: "70%",
                  top: "13%",
                  backgroundColor: "#FBFBFB",
                  boxShadow: "none",
                  borderRadius: 10,
                }}
              >
                <LocalizationProvider
                  dateAdapter={AdapterLuxon}
                  //   localeText={{ start: "Check-in", end: "Check-out" }}
                >
                  <DatePicker
                    label="Start date"
                    value={value}
                    // inputFormat="DD/MMM/YYYY"
                    mask="__/__/___"
                    onChange={(newValue) => {
                      setValue(newValue);
                    }}
                    renderInput={(Props) => (
                      <React.Fragment>
                        <TextField {...Props} />
                        <Box sx={{ mx: 2 }}> to </Box>
                      </React.Fragment>
                    )}
                  />
                  <DatePicker
                    label="End date"
                    value={value2}
                    // inputFormat="DD/MMM/YYYY"
                    mask="__/__/____"
                    onChange={(newValue) => {
                      setValue2(newValue);
                    }}
                    renderInput={(Props) => (
                      <React.Fragment>
                        <TextField {...Props} />
                      </React.Fragment>
                    )}
                  />
                </LocalizationProvider>
              </Paper>
            </div>

            <div style={{ position: "absolute", left: 175, top: 180 }}>


            </div>
          </Box>
        </div>
      );
}

export default Notificaion;
